import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
var t = new Date();
var time = t.getHours();
var sen = "Good Night";

const CssStyle = { };
if(time <= 12){ sen = "Good Morning";  CssStyle.color = 'green'; }
else if(time<=4){ sen ="Good After-Noon"; CssStyle.color ='pink'; }
else if(time<=7){ sen = "Good Evening"; CssStyle.color = 'yellow'; }
else{ sen = "Good Night"; CssStyle.color= "red"; }

ReactDOM.render(
  <>
    <div>
      <h1>HII EVERYONE,<span style = {CssStyle}> { sen }</span></h1>
    </div> 
  </>,
  document.getElementById('root')
);
